import React, { useEffect, useState } from "react";
import Navbarcomponent from "../navbar";
import axios from "axios";
import { useParams } from "react-router";

function BookingStatus() {
  const [customerBook, setCustomerBook] = useState({});
  const { id } = useParams();

  useEffect(() => {
    axios
      .get(`http://localhost:8182/customerBook/customerid/${id}`)
      .then((response) => {
        console.log("API response:", response.data);
        setCustomerBook(response.data);
      })
      .catch((error) =>
        console.error("Error fetching customer books:", error)
      );
  }, [id]);

  return (
    <div>
      <Navbarcomponent />
      <h1>Booking Status</h1>
      {customerBook && (
        <div>
          <p>
            <strong>Issue Date:</strong> {customerBook.issueDate}
          </p>
          <p>
            <strong>Return Date:</strong> {customerBook.returnDate}
          </p>
          <p>
            <strong>Fine:</strong> {customerBook.amount}
          </p>
        </div>
      )}
    </div>
  );
}

export default BookingStatus;
